import React from 'react'

const UploadCsv = () => {
  const filech =(e)=>{
    const files = e.target.files;
    const formData= new FormData();
    formData.append('img',files[0]); 
    fetch('/uploadcsv',{
      method:"POST",
      body:formData
    })
  }
  return (
    <div>
      <h1>csv</h1>
      <input type="file" onChange={filech}  name="img"/>
    </div>
  )
}

export default UploadCsv
